
<style>
/* 整体页面样式 */
body {
    font-family: Arial, sans-serif;
    background-color: #1e1e1e; /* 深色背景 */
    color: #ffffff; /* 白色文字 */
    margin: 0;
    padding: 20px;
}

/* 图表容器样式 */
.plotly-graph-div {
    background-color: #2a2a2a; /* 图表背景色 */
    border-radius: 10px;
    padding: 20px;
    margin-bottom: 20px;
}

/* 表格容器样式 */
.table-container {
    max-height: 400px; /* 固定表格高度 */
    overflow-y: auto; /* 添加垂直滚动条 */
    background-color: #2a2a2a; /* 表格背景色 */
    border-radius: 10px;
    padding: 10px;
    margin-top: 20px;
}

/* 表格样式 */
table {
    width: 100%;
    border-collapse: collapse;
    font-family: Arial, sans-serif;
}

table th, table td {
    padding: 12px;
    text-align: center;
    border: 1px solid #444; /* 表格边框 */
}

table th {
    background-color: #333; /* 表头背景色 */
    color: #ffffff; /* 表头文字颜色 */
    font-size: 14px;
    font-weight: bold;
}

table td {
    background-color: #2a2a2a; /* 单元格背景色 */
    color: #ffffff; /* 单元格文字颜色 */
    font-size: 12px;
}

/* 交替行背景色 */
table tr:nth-child(even) td {
    background-color: #333; /* 偶数行背景色 */
}

/* 滚动条样式 */
.table-container::-webkit-scrollbar {
    width: 8px;
}

.table-container::-webkit-scrollbar-track {
    background: #2a2a2a; /* 滚动条轨道颜色 */
    border-radius: 4px;
}

.table-container::-webkit-scrollbar-thumb {
    background: #666; /* 滚动条滑块颜色 */
    border-radius: 4px;
}

.table-container::-webkit-scrollbar-thumb:hover {
    background: #888; /* 滚动条滑块悬停颜色 */
}
</style>
